import React from 'react';
import '../styles/Team.css';

const Team = () => {
    return (
        <div className="team__container">
            <div className="team__header">Contributors</div>

            <div className="team__devs">
                <span className="team__subheader">Developers</span>
            </div>
        </div>
    )
}

export default Team
